import React from 'react';
import '../App.css'

const ResumePage = () => {
  return (
    <div className="resume-container">
      <h1>Резюме проекту</h1>
      <p><strong>Тема:</strong> Назва вашого проекту</p>
      <p><strong>Виконавець:</strong> Ваше ім'я</p>
      <p><strong>Курс:</strong> Інформація про курс</p>
      <p><strong>Дата:</strong> Відповідна дата</p>
      <p><strong>Опис:</strong> Короткий опис проекту і його цілей.</p>
      <p><strong>Технології:</strong> Перелік використаних технологій та інструментів.</p>
      // Тут можна додати більше інформації за бажанням
    </div>
  );
};

export default ResumePage;
